import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <body>
        <ul>
          <li>
            <a href="default.asp">Home</a>
          </li>
          <li>
            <a href="news.asp">News</a>
          </li>
          <li>
            <a href="contact.asp">Contact</a>
          </li>
          <li>
            <a href="about.asp">About</a>
          </li>
        </ul>
        <header>Hello!</header>
      </body>
    </div>
  );
}

export default App;
